object.script:
X_OFFSET = 1 Y_OFFSET = 1
HEADING_HEIGHT = 8 LINE_HEIGHT = 8
myAmountOfModules = 0 moduleFlag = {}
MODULE_NAMES = {"Drive Mod", "Light Mod", "Passenger Mod", "Cam Mod", "Audio Mod", "Warnings/Status Mod","Decouple Mod","Pantograph mod","Power Mode Mod"}
for i=1,32 do moduleFlag[i] = false end
function onTick() for i=1,32 do moduleFlag[i] = input.getBool(i) end end
function onDraw() screen.setColor(30,30,255) screen.drawTextBox(0, Y_OFFSET, screen.getWidth(), HEADING_HEIGHT, "Detected Modules", 0, 0) screen.setColor(30,30,30)
-- print all modules onto the screen for i=1,32 do if moduleFlag[i] then text = MODULE_NAMES[i] if text == nil then text = "???" end screen.drawText(X_OFFSET+1, Y_OFFSET + HEADING_HEIGHT + myAmountOfModules * LINE_HEIGHT, "[" .. i .. "] " ..text) myAmountOfModules = myAmountOfModules + 1 end end
myAmountOfModules = 0 end

